import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component{
  constructor() {
    super();

    this.state = {
      monster: [
        {
          name: "Dracula"
        },
        {
          name: "Frankenstein"
        },
        {
          name: "Witch"
        }
      ]
    };
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monster.map(monster => <h1>{monster.name}</h1>)
        }
      </div>
    );
  }
}

